('Ship_VY', 1, 'D1(Quad)', 'Superior Oceanview Stateroom With Balcony (occ 4', ' (4)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area and a private bathroom. Rates vary from deck to deck. (179 sq. ft., balcony 52 sq. ft.)</p>', '<p> (17952)</p>', 4, 'upload/image/Ocean View with Balcony D1 E1 D2 D3 E2 E3.jpg', 1436943506, 1470397409),
('Ship_VY', 2, 'D2/D3', 'Superior Oceanview Stateroom With Balcony', '', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area and a private bathroom. Rates vary from deck to deck. (179 sq. ft., balcony 52 sq. ft.)</p>', '<p> (17952)</p>', 2, 'upload/image/Ocean View with Balcony D1 E1 D2 D3 E2 E3-527.jpg', 1436943732, 1454570092),
('Ship_VY', 3, 'E1(Triple)', 'Deluxe Oceanview Stateroom with Balcony (occ 3)', ' (3)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area with sofa, and a private bathroom. Rates vary from deck to deck. (164 sq. ft., balcony 51 sq. ft.)</p>', '<p> (16451)</p>', 3, 'upload/image/Ocean View with Balcony D1 E1 D2 D3 E2 E3-353.jpg', 1436943584, 1444896904),
('Ship_VY', 4, 'E2/E3', 'Deluxe Oceanview Stateroom with Balcony', '', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area with sofa, and a private bathroom. Rates vary from deck to deck. (164 sq. ft., balcony 51 sq. ft.)&nbsp;</p>', '<p> (16451)</p>', 2, 'upload/image/Ocean View with Balcony D1 E1 D2 D3 E2 E3-648.jpg', 1436945081, 1440660257),
('Ship_VY', 5, 'F', 'Large Oceanview Stateroom (Cat. F)', ' (Cat. F)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area with sofa, vanity area and a private bathroom. (178 sq. ft.)</p>', '<p> 178</p>', 2, 'upload/image/Oceanview FO F H I.jpg', 1436945520, 1469502967),
('Ship_VY', 6, 'FO', 'Family Oceanview Stateroom', '', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, additional bunk beds in separate area, separate sitting area with sofa bed, and a private bathroom with shower. (262 sq. ft.)&nbsp;</p>', '<p> 262</p>', 4, 'upload/image/Oceanview FO F H I-496.jpg', 1436945448, 1436945532),
('Ship_VY', 7, 'FS', 'Family Suite', ' ', '<p>Two bedrooms with two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long (one room with third and fourth Pullman beds), two bathrooms (one with shower, one with bathtub), living area with double sofa bed, private balcony and concierge service. <br />(561 sq. ft., balcony 246 sq. ft)</p>', '<p> (561246)&nbsp;</p>', 6, 'upload/image/013 Grand Suite_resize.jpg', 1436782278, 1454462957),
('Ship_VY', 8, 'GS', 'Grand Suite', '', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area (some with sofa bed) and concierge service. (349 sq. ft., balcony 100 sq. ft.)</p>', '<p> 349100</p>', 4, 'upload/image/020 Grande Suite_resize.jpg', 1436944873, 1454570129),
('Ship_VY', 9, 'H(Triple)', 'Oceanview Stateroom (occ3)', ' (3)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area , vanity area, and a private bathroom. (160 sq. ft.)</p>', '<p> 160</p>', 3, 'upload/image/Oceanview FO F H I-370.jpg', 1436945635, 1440405024),
('Ship_VY', 10, 'I', 'Oceanview Stateroom (Cat. I)', ' (Cat. I)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area , vanity area, and a private bathroom. (160 sq. ft.)</p>', '<p> 160</p>', 2, 'upload/image/Oceanview FO F H I-157.jpg', 1436945673, 1469502991),
('Ship_VY', 11, 'J', 'Interior Stateroom with Virtual Balcony', '', '<p>Offer the innovative design concept that brings virtual balconies to interior staterooms offering expansive real-time views of the ocean and exciting destinations.</p>', '<p></p>', 2, 'upload/image/Interior with Virtual Balcony J.jpg', 1436945751, 1439350787),
('Ship_VY', 12, 'JS', 'Junior Suite', '', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area (some with sofa bed) and private batroom. (264 sq. ft., balcony 75 sq. ft.)&nbsp;</p>', '<p> (26475)</p>', 4, 'upload/image/GS7_0849.jpg', 1436943389, 1454570146),
('Ship_VY', 14, 'K/L', 'Interior Stateroom (occ 4)', ' (4)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area, vanity area and a private bathroom. (150 sq. ft.)</p>', '<p> (150)</p>', 4, 'upload/image/Interior J K L M N Q.jpg', 1436945787, 1440404882),
('Ship_VY', 15, 'M', 'Interior Stateroom (Cat.M)', ' (Cat.M)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area, vanity area and a private bathroom. (150 sq. ft.)</p>', '<p> (150)</p>', 2, 'upload/image/Interior J K L M N Q-34.jpg', 1436946216, 1469502928),
('Ship_VY', 16, 'N/Q', 'Interior Stateroom (Cat. N/Q)', ' (Cat. N/Q)', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area, vanity area and a private bathroom. (150 sq. ft.)</p>', '<p> (150)</p>', 2, 'upload/image/Interior J K L M N Q-62.jpg', 1436946256, 1469502944),
('Ship_VY', 17, 'OS', 'Owner Suite', '', '<p>Queen-size bed, private balcony, separate living area with queen-size sofa bed, private bathroom with bathtub, separate shower and bidet, and concierge service. <br />(559 sq. ft., balcony 90 sq. ft.) </p>', '<p> <br />55990</p>', 4, 'upload/image/009 Owner''s Suite.jpg', 1436781811, 1436781905),
('Ship_VY', 18, 'P1', 'Panoramic Oceanview Stateroom *NEW*', '', '<p>Two lower twin beds that convert to Royal King, measuring 72.5 inches wide by 82 inches long. Double sofa bed. Vanity with sitting area. Private bathroom with shower. Floor to ceiling wrap around panoramic window, 76 inches high by 253 inches wide. (283 sq. ft.)&nbsp;</p>', '<p>76&rdquo;x 253&rdquo;  (283)&nbsp;</p>', 4, 'upload/image/Panoramic Ocean View P1 P2-269.jpg', 1436945337, 0),
('Ship_VY', 19, 'P2', 'Panoramic Oceanview Stateroom *NEW*', '', '<p>Two lower twin beds convert to Royal King, measuring 72.5 inches wide by 82 inches long. Double sofa bed for quad staterooms. Vanity with sitting area, Private bathroom with shower. Floor to Ceiling wrap around panoramic window, 76 inches high by 103 inches wide. (Staterooms size varies from 191 to 215 sq. ft.)&nbsp;</p>', '<p>76&rdquo;x 103&rdquo;  (191-215)&nbsp;</p>', 4, 'upload/image/Panoramic Ocean View P1 P2-354.jpg', 1436945375, 0),
('Ship_VY', 20, 'PF', 'Panoramic Oceanview Family Stateroom *NEW*', '', '<p>Two lower twin beds that convert to Royal King, measuring 72.5 inches wide by 82 inches long. Curtained section with bunk beds. Living area with double sofa bed, vanity and sitting area. One and a half baths with shower. Floor to ceiling wrap around panoramic windows, 76 inches high by 321 inches wide. (406 sq. ft.)</p>', '<p>76&rdquo;x 321&rdquo;  (406)&nbsp;</p>', 4, 'upload/image/Panoramic Ocean View P1 P2.jpg', 1436945285, 1436948459),
('Ship_VY', 21, 'PR', 'Promenade Stateroom', '', '<p>Bowed windows with a view of the Royal Promenade, two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area with sofa, vanity area and a private bathroom. (160 sq. ft.)</p>', '<p> (160)</p>', 2, 'upload/image/Promenade PR.jpg', 1436945710, 1439350682),
('Ship_VY', 22, 'RS', 'Royal Suite', '', '<p>Separate bedroom with king-size bed, private balcony with hot tub, whirlpool bathtub, living room with queen-size sofa bed, baby grand piano, and concierge service. <br />(1,087 sq. ft., balcony 217 sq. ft.)</p>', '<p> <br />1,087217</p>', 4, 'upload/image/Royal Suite.jpg', 1436782389, 1436948398),
('Ship_MA', 23, 'E2/E3', 'Deluxe Ocean View Stateroom with Balcony', '', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area with sofa, and a private bathroom. Rates vary from deck to deck.<br />(184 sq. ft., balcony 50 sq. ft.)<br /><br /></p>', '<p> (18450)</p>', 2, 'upload/image/-_resize.jpg', 1444808646, 1444897572),
('Ship_MA', 26, 'I', 'Oceanview Stateroom', '', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area with sofa, vanity area, and a private bathroom. <br />(160 sq. ft.)</p>', '<p> 160</p>', 2, 'upload/image/-_resize-642.jpg', 1444898558, 0),
('Ship_MA', 27, 'N/Q', 'Interior Stateroom', '', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area with sofa, vanity area, and a private bathroom. <br />(150 sq. ft.)</p>', '<p> (150)&nbsp;</p>', 2, 'upload/image/-_resize.jpg', 1444898688, 0),
('Ship_MA', 28, 'M', 'Interior Stateroom', '', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area with sofa, vanity area, and a private bathroom. <br />(150 sq. ft.)</p>', '<p> (150)</p>', 2, 'upload/image/-_resize-938.jpg', 1444898768, 0),
('Ship_MA', 29, 'E1(Triple)', 'Deluxe Oceaview Stateroom with Balcony', '', '<p>Two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, private balcony, sitting area with sofa, and a private bathroom. Rates vary from deck to deck. <br />(184 sq. ft., balcony 50 sq. ft.)</p>', '<p> (18450)</p>', 3, 'upload/image/-_resize-216.jpg', 1444899015, 0),
('Ship_QN', 30, 'OS', 'Owner Suite', '', '<p>Bedroom area with two twin beds that convert to Royal King, measuring 72.5 inches wide by 82 inches long. Full bathroom with tub and two sinks. Separate half bath. Marble entry, large closets, living area with dining table and sofa that converts to double bed. Wrap around private balcony with seating area and private outdoor dining. Sleeps up to 4. <br />(541 sq. ft., balcony 259 sq. ft.)</p>', '<p>, 72.5" x 82" </p>\r\n<p>541259</p>', 2, 'upload/image/RCI_QN-OwnerSuiteF.jpg', 1446696130, 1446696155),
('Ship_QN', 31, 'GS', 'Grand Suite', '', '<p>Bedroom area with two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, and separate dressing area with entrance to bathroom. Full bathroom with tub, two sinks and second entrance that opens to living room. Living room with sofa that converts to double bed, entertainment center, and writing desk. Private balcony with seating area and private dining. Sleeps up to 4. <br />(351 sq. ft., balcony 109 sq. ft.)</p>', '<p>, 72.5" x 82" </p>\r\n<p>351109</p>', 2, 'upload/image/RCI_QN-GrandSuiteF.jpg', 1446696643, 0),
('Ship_QN', 32, 'JS', 'Junior Suite', '', '<p>Bedroom area with two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long. Full bathroom with tub. Sitting area with sofa that converts to double bed. Large corner private balcony. Semi-private vestibule can be used to connect adjacent Studio Interior Stateroom and Ocean View Balcony Stateroom. Sleeps up to 4.<br />(276 sq. ft., balcony 161 sq. ft.)</p>', '<p>, 72.5" x 82" </p>\r\n<p>(276161)</p>', 2, 'upload/image/RCI_QN-FamJuniorSuiteF.jpg', 1446696715, 0),
('Ship_QN', 33, 'D1', 'Deluxe Oceaview Stateroom With Balcony', '', '<p>Enjoy these luxurious staterooms (198 sq. ft.) with two twin beds that convert to a Royal King, measuring 72.5 inches wide by 82 inches long, sitting area with sofa, full bathroom and private balcony (55 sq. ft.). <br />(198 sq. ft., balcony 55 sq. ft.)</p>\r\n<p>Note: Decks: 7, 8, 9, 10, 11, 12 and 13 Balconies range from 55 to 119 sq. ft.</p>', '<p>, 72.5" x 82" </p>\r\n<p>(19855)</p>\r\n<p>:  55-119)</p>', 4, 'upload/image/RCI_QN-Balcony.jpg', 1446696773, 1447306594),
